import React, { Component } from "react";
import { Container, Row, Col } from "react-bootstrap";

export class resume extends Component {
  render() {
    return (
      <div id="resume" class="container-fluid">
        <div class="row justify-content-md-center">
          <h1>Developer | Designer | Life Learner</h1>
        </div>
        <p>
          Background in Mathematics and Computer Science. Graduated From
          California State University Channel Islands in 2011. Recieved a
          Bachelors of Science in Mathematics with emphasis in Computer Science.
        </p>
        <h2>Skills</h2>
